    upper Birch Creek and its immediate environment fulfill. The requirements of the
    Wild and Scenic Rivers Act, and criteria established jointly by the Secretary of
    the Interior and the Secretary of Agriculture, as published in Guidelines for Evaluating
    Wild, Scenic and Recreational River Areas Proposed for Inclusion in the National
    Wild And Scenic Rivers System Under Section 2, Public Law 92-542, February 1970.
